<template>
	<view class="pdf-container">
		<view class="pdf-watermark-input">
			<defaultInput :placeholder="'请输入水印文字'" @changeInput="handleChangeTextValue" />
			<view class="pdf-watermark-input-buttons">
				<button @tap="handleShowPopup">设置</button>
				<button @tap="chooseFile" type="primary">选择</button>
			</view>
		</view>
	</view>
	<t-color-picker ref="colorPicker" :color="color" @confirm="confirm"></t-color-picker>
	<view v-if="isShowPopup">
		<view class="barrage-popup-bg" @tap="handleClosePopup"></view>
		<view class="barrage-popup">
			<view class="barrage-popup-container">
				<view class="barrage-popup-header" @tap="handleClosePopup">
					<view class="left"></view>
					<view class="center">水印设置</view>
					<image class="right" src="/static/moreApp/close.svg"></image>
				</view>
				<view class="barrage-popup-content">
					<view class="barrage-setting-item-container">
						<view class="barrage-setting-color" @tap="open('字体颜色')">
							<text class="barrage-setting-item-title">字体颜色</text>
							<view class="barrage-setting-color-detail" :style="{backgroundColor:fontColor}" />
						</view>
					</view>
					<view class="barrage-setting-item-container">
						<view class="barrage-setting-item-title">字号</view>
						<view class="barrage-setting-item-slider">
							<slider :value="nowFontSize" @change="sliderChange" min="0" max="200" show-value />
						</view>
					</view>
					<view class="barrage-setting-item-container">
						<view class="barrage-setting-item-title">水平值</view>
						<view class="barrage-setting-item-slider">
							<slider :value="xValue" @change="sliderChangeXValue" min="0" max="500" show-value />
						</view>
					</view>
					<view class="barrage-setting-item-container">
						<view class="barrage-setting-item-title">旋转值</view>
						<view class="barrage-setting-item-slider">
							<slider :value="rotateValue" @change="sliderChangeRotateValue" min="-180" max="180"
								show-value />
						</view>
					</view>
				</view>
				<view class="barrage-popup-button">
					<button @tap="handleClosePopup" type="default">关闭</button>
				</view>
			</view>
		</view>
	</view>
</template>

<script>
	import * as PDFMIN from '@/common/utils/pdf-lib.min.js';
	import * as fontkitPackage from '@/common/utils/fontkit.umd.min.js';
	let PDFMANAGER
	let fontkit
	
	// fontkit = require('../../common/utils/fontkit.umd.min.js');
	// PDFMANAGER = require('../../common/utils/pdf-lib.min.js');

	export default {
		data() {
			return {
				watermark: '',
				isShowPopup: false,
				nowFontSize: 50,
				xValue: 5,
				rotateValue: -45,
				fontColor: '#000000',
				color: {
					r: 0,
					g: 0,
					b: 0,
					a: 1
				},
				rgba: {
					r: 0 / 255,
					g: 0 / 255,
					b: 0 / 255,
					a: 1
				}
			}
		},
		methods: {
			rgbaToHex(r, g, b, a) {
				const red = r.toString(16).padStart(2, '0');
				const green = g.toString(16).padStart(2, '0');
				const blue = b.toString(16).padStart(2, '0');
				const alpha = Math.round(a * 255).toString(16).padStart(2, '0').slice(2);
				return `#${alpha}${red}${green}${blue}`;
			},
			normalizeRGBA(rgba) {
				return {
					r: rgba.r / 255,
					g: rgba.g / 255,
					b: rgba.b / 255,
					a: rgba.a
				}
			},
			handleChangeTextValue(e) {
				this.watermark = e
			},
			chooseFile(e) {
				if (this.watermark == '') {
					uni.showToast({
						icon: 'error',
						title: `请输入水印`
					})
				} else {
					let that = this
					wx.chooseMessageFile({
						count: 1,
						type: 'file',
						extension: ['.pdf'],
						success: res => {
							try {
								const path = res.tempFiles[0].path
								const fs = wx.getFileSystemManager()
								const data = new Uint8Array(fs.readFileSync(path)) // data为binary数据
								that.process(data)
							} catch (e) {
								console.error(e)
								uni.showModal({
									title: '提示',
									content: "文件读取失败",
									showCancel: false
								})
								return
							}
						}
					})
				}
			},
			process(data) {
				let that = this
				const degrees = PDFMANAGER.degrees
				const PDFDocument = PDFMANAGER.PDFDocument
				const rgb = PDFMANAGER.rgb
				const StandardFonts = PDFMANAGER.StandardFonts
				async function modifyPdf(data) {
					modifyPdfContent(data);
					async function modifyPdfContent(existingPdfBytes) {
						const pdfDoc = await PDFDocument.load(existingPdfBytes);
						// const helveticaFont = await pdfDoc.embedFont(StandardFonts.Helvetica);
						pdfDoc.registerFontkit(fontkit)
						//直接使用字符的base64数据
						const xiaomiFontBuffer =
							""
						const xiaomiFont = await pdfDoc.embedFont(xiaomiFontBuffer)
						const pages = pdfDoc.getPages();
						for (let page of pages) {
							const firstPage = page
							const {
								width,
								height
							} = firstPage.getSize();
							firstPage.drawText(that.watermark, {
								x: that.xValue,
								y: height / 2 + 300,
								size: that.nowFontSize,
								font: xiaomiFont,
								color: rgb(that.rgba['r'], that.rgba['g'], that.rgba['b']),
								rotate: degrees(that.rotateValue)
							});
						}
						const pdfBytes = await pdfDoc.save();
						that.previewData(pdfBytes)
					}
				}
				modifyPdf(data)
			},
			previewData(file) {
				let base64 = wx.arrayBufferToBase64(file);
				// 先写成一个临时文件
				uni.getFileSystemManager().writeFile({
					filePath: `${wx.env.USER_DATA_PATH}/tempPdfWatermarks.pdf`,
					encoding: 'base64',
					data: base64,
					success(res) {
						uni.openDocument({
							showMenu: true,
							filePath: `${wx.env.USER_DATA_PATH}/tempPdfWatermarks.pdf`,
							success: function(res) {
								console.log(res, '打开文件成功')
							},
							fail: function(res) {
								uni.showToast({
									title: '打开文件失败请重试',
									icon: 'none'
								})
							},
						})
					},
					fail(res) {
						console.log("ressss:", res)
					}
				});
			},
			//
			handleShowPopup() {
				this.isShowPopup = true
			},
			handleClosePopup() {
				this.isShowPopup = false
			},
			sliderChange(e) {
				this.nowFontSize = e.detail.value
			},
			sliderChangeXValue(e) {
				this.xValue = e.detail.value
			},
			sliderChangeRotateValue(e) {
				this.rotateValue = e.detail.value
			},
			confirm(e) {
				this.rgba = this.normalizeRGBA(e.rgba);
				this.fontColor = this.rgbaToHex(e.rgba.r, e.rgba.g, e.rgba.b, e.rgba.a)
			},
			open(item) {
				this.$refs.colorPicker.open();
			},
		}
	}
</script>

